import React from 'react'
import { GlobalContext } from './GlobalContext'


const Produto = ({ fetchApi }) => {
  const global = React.useContext(GlobalContext);
  console.log(global.fetchApi)
  if(fetchApi === null) return null
  return (
    <div>
      <ul>
        {fetchApi.map((product) => <li>{product.id}</li>)}
      </ul>
    </div>
    )
}

export default Produto
